import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets

flowFile = session.get()
if (!flowFile) return

try {
    flowFile = session.write(flowFile, { inputStream, outputStream ->
        def text = inputStream.getText(StandardCharsets.UTF_8.name())

        def parts = text.split('----SPLIT----')
        if (parts.size() != 2) {
            throw new IllegalArgumentException("Expected exactly two JSON parts separated by ----SPLIT----")
        }

        def slurper = new JsonSlurper()
        def gameData = slurper.parseText(parts[0].trim())
        def rawDataObj = slurper.parseText(parts[1].trim())

        // Build map from game metadata
        def gameMap = gameData.collectEntries { g ->
            [(g.game_id?.toString()): g]
        }

        // Enrich each stream
        rawDataObj.raw_data?.streams?.each { stream ->
            def gid = stream.game_id?.toString()
            if (gid && gameMap.containsKey(gid)) {
                def g = gameMap[gid]
                stream.game = g.name
                stream.box_art_url = g.box_art_url
            }
        }

        def result = [
            raw_data: rawDataObj.raw_data,
            game_data: gameData  // optional; remove if not needed
        ]

        outputStream.write(JsonOutput.prettyPrint(JsonOutput.toJson(result)).getBytes(StandardCharsets.UTF_8))
    } as StreamCallback)

    session.transfer(flowFile, REL_SUCCESS)
} catch (Exception e) {
    log.error("Enrichment failed: ${e.message}", e)
    session.transfer(flowFile, REL_FAILURE)
}

import groovy.json.JsonSlurper
import groovy.json.JsonOutput

flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def inputJson = new JsonSlurper().parse(inputStream)

    // Parse the `data` field from string to object
    inputJson.data = new JsonSlurper().parseText(inputJson.data)

    def outputJson = JsonOutput.toJson(inputJson)
    outputStream.write(outputJson.getBytes("UTF-8"))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

