import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import org.apache.nifi.processor.io.StreamCallback
import java.nio.charset.StandardCharsets

flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def content = inputStream.getText(StandardCharsets.UTF_8.name())

    // Split the merged content
    def parts = content.split("(?<=\\})\\s*(?=\\[)")
    def pullJson = new JsonSlurper().parseText(parts[0])
    def gameList = new JsonSlurper().parseText(parts[1])

    // Create gameMap for lookup
    def gameMap = [:]
    gameList.each { game ->
        gameMap[game.id.toString()] = game
    }

    // Enrich pullData.streams
    pullJson.data.streams.each { stream ->
        def gameId = stream.game_id?.toString()
        def game = gameMap[gameId]

        stream.game = game ? game.name : null
        stream.channel.game = stream.game
        stream.box_art_url = game ? game.box_art_url : null
    }

    outputStream.write(JsonOutput.toJson(pullJson).getBytes(StandardCharsets.UTF_8))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

