import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import java.nio.charset.StandardCharsets

flowFile = session.get()
if (!flowFile) return

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def inputText = inputStream.getText(StandardCharsets.UTF_8.name())
    def parsedInput = new JsonSlurper().parseText(inputText)

    def records = (parsedInput instanceof List) ? parsedInput : [parsedInput]

    def gameIds = [] as Set
    def channelIds = [] as Set

    records.each { row ->
        def dataStr = row?.data
        def dataJson = dataStr ? new JsonSlurper().parseText(dataStr) : [:]
        def streams = dataJson?.streams ?: []

        streams.each { stream ->
            if (stream?.game_id) gameIds << stream.game_id.toString()
            if (stream?.channel?._id) channelIds << stream.channel._id.toString()
        }
    }

    def gameIdCsv = gameIds.collect { "'${it}'" }.join(",")
    def channelIdCsv = channelIds.collect { "'${it}'" }.join(",")

    def sqlQuery = "SELECT * FROM twitch_game WHERE game_id IN (${gameIdCsv})"

    outputStream.write(sqlQuery.getBytes(StandardCharsets.UTF_8))
} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

import groovy.json.JsonSlurper
import groovy.json.JsonOutput

def flowFile = session.get()
if (!flowFile) return

// Declare variable to hold total outside the session.write
def extractedTotal = null

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def text = inputStream.getText('UTF-8')
    def json = new JsonSlurper().parseText(text)
    def streamData = new JsonSlurper().parseText(json.data)

    // Extract _total value
    extractedTotal = streamData._total

    // Extract game_ids and channel_ids
    def gameIds = []
    def channelIds = []

    streamData.streams.each { stream ->
        if (stream?.game_id) gameIds << stream.game_id
        if (stream?.channel?._id) channelIds << stream.channel._id
    }

    def result = [
        pull_id: json.pull_id,
        game_ids: gameIds.unique(),
        channel_ids: channelIds.unique()
    ]

    outputStream.write(JsonOutput.toJson(result).getBytes('UTF-8'))
} as org.apache.nifi.processor.io.StreamCallback)

// Set extracted _total as a FlowFile attribute (if it was found)
if (extractedTotal != null) {
    flowFile = session.putAttribute(flowFile, "extracted_total", extractedTotal.toString())
}

session.transfer(flowFile, REL_SUCCESS)
